import React from "react";
import {UserItem} from './Follow'

const Profile= function(props){
let myDetails={props}
let userList={props}
userList=[{
  username:'a.lover',
  name:'akshay neje'

},
{
  username:'onkar',
  name:'onkar kadam'
},
{
  username:'praju',
  name:'prajakta mali'

}]
  return(
    <div>
      <div>
        <div id="profile">
          <img
          src={myDetails.avatarUrl}
          alt={myDetails.username}
          className="h-12 w-12 rounded-full object-cover mr-4"
          />
        </div>
        <div id="my-tweets">
          <p>{myDetails.tweets}</p>
          <p>Tweets</p>
        </div>
        <div id="follower">
          <p>{myDetails.follower}</p>
          <p>Followers</p>
        </div>
        <div id="following">
          <p>{myDetails.following}</p>
          <p>Following</p>
        </div>
        <div id="list">
          
          {
            userList.forEach(element => {
              console.log(element)
              return <UserItem userDetails={element}/>
            })
          }

        </div>
          
      </div>
    </div>
  )
}

export {Profile}
